import React from 'react';
import { Box, Heading } from 'grommet';

const landing = props => {
  return (
    <React.Fragment>

      <Box  border={{ color: 'brand', size: 'large' }}>
        <Heading>Find places to eat in:</Heading>
      </Box>

      <Box   border={{ color: 'brand', size: 'large' }}>
        <Heading>{props.location}</Heading>
      </Box>

    </React.Fragment>
  )
}

export default landing;
